(207, 'featured_stores', 'a:8:{i:0;a:1:{s:2:"ID";i:613;}i:1;a:1:{s:2:"ID";i:614;}i:2;a:1:{s:2:"ID";i:615;}i:3;a:1:{s:2:"ID";i:616;}i:4;a:1:{s:2:"ID";i:617;}i:5;a:1:{s:2:"ID";i:618;}i:6;a:1:{s:2:"ID";i:619;}i:7;a:1:{s:2:"ID";i:620;}}', 'yes'),
(208, 'cat_extra_text_587', '<p>PremiumPress design and develop quality, feature rich Premium Wordpress Themes for small, medium and large businesses.</p>\n<p>All our premium Wordpress themes are constantly improving, developed by experts and include unlimited installations, lifetime free support and upgrades!</p>', 'yes'),
(209, 'cat_extra_text_588', '<p>I created this website to provide WordPress themes of quality and integrity. I craft my themes with a goal of simplicity and professionalism and strive to inject each design with a dose of modest elegance. I believe that your website is not just a tool, it is an integral part of your identity. </p>\n<p>My job is to respect each customer by providing attractive and userfriendly templates that will help you achieve your online goals.</p>', 'yes'),
(210, 'cat_extra_text_589', '<p>Your website is important. That''s why we create both premium & free CMS themes for WordPress that make it easy to have a great looking website with tons of capability.</p>', 'yes'),
(211, 'cat_extra_text_590', '<p>StudioPress themes are a perfect solution for small businesses or individuals looking to establish their online presence with a WordPress blog or website.</p>', 'yes'),
(212, 'cat_extra_text_591', '<p>Premium Wordpress themes are ready-made website templates, that can transform your dull & boring blog into an exciting and interactive website - no coding skills necessary!</p>', 'yes'),
(213, 'cat_extra_text_592', '<p>We create quality and professionally designed wordpress themes. We offer themes for your business, blog or personal sites. All of that comes with our excellent free support.</p>', 'yes'),
(214, 'cat_extra_text_593', '<p>After you become a member, you become part of an ever growing community of Woo Members, where we listen to what you have to say. We can then interact with you on a whole new level and shape our future theme releases towards your needs.</p>', 'yes'),
(215, 'cat_extra_text_594', '<p>Omni Theme WordPress theme that is great for MySpace or Facebook users that are looking for their own website or blog with a more professional and custom look.</p>', 'yes'),
